import { Grid, Typography } from '@mui/material'


function Gridsystem() {
    return (
        <>
            <Typography variant='h4' sx={{ margin: '10px', textAlign: 'center' }}>Grid system </Typography>
            <Grid  container spacing={2}>
                <Grid
                    item
                    xs={6}
                    sm={6}
                    md={9}
                    lg={3}
                    xl={2}
                    sx={{ backgroundColor: 'yellow' }}
                    spacing={2}
                >content A</Grid>
                <Grid
                    item
                    xs={6}
                    sm={6}
                    md={3}
                    lg={9}
                    xl={10}
                    sx={{ backgroundColor: 'red' }}
                    spacing={2}
                >content B</Grid>
                <Grid
                    item
                    xs={3}
                    sm={6}
                    md={3}
                    lg={10}
                    xl={11}
                    sx={{ backgroundColor: 'green' }}
                    spacing={2}
                >content C</Grid>
                <Grid
                    item
                    xs={9}
                    sm={6}
                    md={9}
                    lg={2}
                    xl={1}
                    sx={{ backgroundColor: 'blue' }}
                    spacing={2}
                >content D</Grid>
              
            </Grid>
        </>
    )
}

export default Gridsystem
